import React, { Component, Fragment } from "react";
import {Row, Col} from "react-bootstrap";
import "./animepages.component.css"

export function AnimeInfo(props){
        return (
            <Fragment>
                <Row>
                    <Row>
                        <div>
                        Title: {props.name}

                        </div>
                    </Row>
                    <Row>
                        <div>Genres: {props.genre}</div>
                    </Row>
                    <Row>

                    </Row>
                    <Row>

                    </Row>
                    <div>Summary: </div>
                    <div>{props.summary}</div>
                    <div>Season: {props.season} {props.seasonYear}</div>
                    <div>Episodes: {props.episodes}</div>
                </Row>
            </Fragment>
            
        );
}

export function KeyStaff(props) {
        return (
            <Fragment>
                <Col>
                    <div>Studio: {props.studio}</div>
                </Col>
            </Fragment>
            
        );
}

export class Rating extends Component {
    render() {
        return (
            <Fragment>
                <Col>
                    <div>Sample Rating</div>
                    <div>10/10</div>
                </Col>
            </Fragment>
            
        );
    }
}

export class Recommendations extends Component {
    render() {
        return (
            <Fragment>
                <Col>
                <div>Anime One</div>
                <div>Anime Two</div>
                </Col>
            </Fragment>
            
        );
    }
}

export class Reviews extends Component {
    render() {
        return (
            <Fragment>
                <Col>
                <div>Review One</div>
                <div>Review Two</div>
                </Col>
            </Fragment>
            
        );
    }
}
